// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract SplitRouter is Ownable, ReentrancyGuard {
    // Constants
    uint256 public constant USER_SHARE = 80;
    uint256 public constant POL_SHARE = 18;
    uint256 public constant PLATFORM_FEE = 2;
    uint256 public constant FEE_DENOMINATOR = 100;
    address public constant DEV_WALLET = 0x1831510811Ddd00E6180C345F00F12C4536abaa3;
    uint256 public constant BASE_CHAIN_ID = 8453;
    uint256 public constant BASE_SEPOLIA_CHAIN_ID = 84532;
    uint256 public constant BASE_GOERLI_CHAIN_ID = 84531;

    // Addresses
    address public immutable HIGHER;
    address public immutable WETH;
    address public immutable UNISWAP_POOL;
    address public immutable UNISWAP_ROUTER;
    address public immutable POSITION_MANAGER;

    event SwapExecuted(address indexed user, address indexed tokenIn, uint256 amountIn, uint256 amountOut, uint256 polAmount, uint256 platformFee);

    constructor(
        address _higher,
        address _weth,
        address _uniswapPool,
        address _uniswapRouter,
        address _positionManager
    ) {
        require(block.chainid == BASE_CHAIN_ID || block.chainid == BASE_SEPOLIA_CHAIN_ID || block.chainid == BASE_GOERLI_CHAIN_ID, "SplitRouter: Only works on Base network");
        HIGHER = _higher;
        WETH = _weth;
        UNISWAP_POOL = _uniswapPool;
        UNISWAP_ROUTER = _uniswapRouter;
        POSITION_MANAGER = _positionManager;
    }

    /**
     * @dev Execute a single token swap with 80/18/2 split
     * @param tokenIn Address of the input token
     * @param amountIn Amount of input token to swap
     * @param minReceive Minimum HIGHER tokens to receive
     */
    function executeSwap(
        address tokenIn,
        uint256 amountIn,
        uint256 minReceive
    ) external nonReentrant {
        require(tokenIn != address(0), "Invalid token address");
        require(amountIn > 0, "Amount must be greater than 0");
        require(tokenIn != HIGHER, "Cannot swap HIGHER to HIGHER");

        // Transfer tokens from user to this contract
        IERC20(tokenIn).transferFrom(msg.sender, address(this), amountIn);

        // Execute the split swap
        _executeSplitSwap(tokenIn, amountIn, minReceive);
    }

    /**
     * @dev Execute bulk swap for multiple dust tokens
     * @param tokens Array of token addresses to swap
     * @param amounts Array of amounts to swap
     * @param minReceive Minimum HIGHER tokens to receive
     */
    function executeBulkSwap(
        address[] calldata tokens,
        uint256[] calldata amounts,
        uint256 minReceive
    ) external nonReentrant {
        require(tokens.length == amounts.length, "Arrays length mismatch");
        require(tokens.length > 0, "Empty arrays");

        uint256 totalValueUSD = 0;
        uint256 totalHigherReceived = 0;

        // Transfer all tokens and calculate total value
        for (uint256 i = 0; i < tokens.length; i++) {
            require(tokens[i] != address(0), "Invalid token address");
            require(amounts[i] > 0, "Amount must be greater than 0");
            require(tokens[i] != HIGHER, "Cannot swap HIGHER to HIGHER");

            IERC20(tokens[i]).transferFrom(msg.sender, address(this), amounts[i]);

            // Calculate USD value (simplified for now)
            totalValueUSD += _getTokenValueUSD(tokens[i], amounts[i]);
        }

        // Execute bulk swap
        uint256 lpTokenId = _executeBulkSplitSwap(tokens, amounts, minReceive);

        emit SwapExecuted(msg.sender, address(0), totalValueUSD, totalHigherReceived, 0, 0);
    }

    /**
     * @dev Internal function to execute split swap
     */
    function _executeSplitSwap(
        address tokenIn,
        uint256 amountIn,
        uint256 minReceive
    ) internal {
        // Calculate splits
        uint256 userAmount = (amountIn * USER_SHARE) / FEE_DENOMINATOR;
        uint256 polAmount = (amountIn * POL_SHARE) / FEE_DENOMINATOR;
        uint256 platformFee = (amountIn * PLATFORM_FEE) / FEE_DENOMINATOR;

        // For now, just transfer tokens to appropriate addresses
        // In production, this would interact with Uniswap V3

        // Transfer user share to user (simplified - just HIGHER tokens)
        IERC20(HIGHER).transfer(msg.sender, userAmount);

        // Transfer POL share to LP position (simplified)
        IERC20(HIGHER).transfer(UNISWAP_POOL, polAmount);

        // Transfer platform fee to dev wallet
        IERC20(WETH).transfer(DEV_WALLET, platformFee);

        emit SwapExecuted(msg.sender, tokenIn, amountIn, userAmount, polAmount, platformFee);
    }

    /**
     * @dev Internal function to execute bulk split swap
     */
    function _executeBulkSplitSwap(
        address[] calldata tokens,
        uint256[] calldata amounts,
        uint256 minReceive
    ) internal returns (uint256) {
        uint256 totalUserAmount = 0;
        uint256 totalPolAmount = 0;
        uint256 totalPlatformFee = 0;

        for (uint256 i = 0; i < tokens.length; i++) {
            uint256 userAmount = (amounts[i] * USER_SHARE) / FEE_DENOMINATOR;
            uint256 polAmount = (amounts[i] * POL_SHARE) / FEE_DENOMINATOR;
            uint256 platformFee = (amounts[i] * PLATFORM_FEE) / FEE_DENOMINATOR;

            totalUserAmount += userAmount;
            totalPolAmount += polAmount;
            totalPlatformFee += platformFee;
        }

        // Transfer amounts (simplified)
        IERC20(HIGHER).transfer(msg.sender, totalUserAmount);
        IERC20(HIGHER).transfer(UNISWAP_POOL, totalPolAmount);
        IERC20(WETH).transfer(DEV_WALLET, totalPlatformFee);

        return 0; // Placeholder for LP token ID
    }

    /**
     * @dev Get token value in USD (simplified)
     */
    function _getTokenValueUSD(address token, uint256 amount) internal view returns (uint256) {
        // Simplified implementation - in production would use Chainlink price feeds
        return amount; // Placeholder
    }

    /**
     * @dev Emergency function to withdraw stuck tokens
     */
    function emergencyWithdraw(address token) external onlyOwner {
        uint256 balance = IERC20(token).balanceOf(address(this));
        IERC20(token).transfer(owner(), balance);
    }
}

